/*
  @params
  options -> [{label, value}...]
  handler -> function(value)
*/
const Selector = ({options, handler}) => {
  const selector_options = options.map((option, i) => {
    console.log(option)
    return (
      <div key={i} className="selector__option" data-value={option.value}>{option.label}</div>
    )
  })
  return (
    <div className="selector">
      <div className="selector__value" data-value=""> Выберите </div>
      <div className="selector__options">
        {selector_options}
      </div>
    </div>
  )
}

export default Selector
